import React, { useEffect, useState } from "react";
import {
  Nav,
  NavMenuLeft,
  ResponsiveNavButton,
} from "../../styled-components/NavbarStyles";

function HeaderLoginRegister() {
  return (
    <div>
      <Nav>
        <NavMenuLeft>
          <h1 className="fw-bold">CourierPedia</h1>
          <ResponsiveNavButton>
            <i className="bi bi-list"></i>
          </ResponsiveNavButton>
        </NavMenuLeft>
      </Nav>
    </div>
  );
}

export default HeaderLoginRegister;
